var suffixes = ["JUNIOR", "JR", "SENIOR", "SR", "III", "IV"];

function randBool() {
	return Math.random() >= 0.5;
}
function nameLength(input) {
	var len = 0;
	for (var i=0; i<input.length; i++) {
			len += input[i].length;
	}
	return len;
}
function randomName(length) {

	while (true) {
		var name = [];
		var lastFirst = randBool();

		var fi = Math.floor(Math.random()*firsts.length);
		var mi = Math.floor(Math.random()*firsts.length);
		var li = Math.floor(Math.random()*lasts.length);
		var si = Math.floor(Math.random()*suffixes.length);

		var lastName = lasts[li];
		var firstName = firsts[fi];
		var middleName = firsts[mi];
		var middle = randBool();
		var middleInitial = randBool();
		var suffix = randBool();
		var suffixName = suffixes[si];

		if (lastFirst) {
			name[name.length] = lastName;
			name[name.length] = firstName;
			if (middle) {
				if (middleInitial) name[name.length] = middleName[0];
				else name[name.length] = middleName;
			}
		} else {
			name[name.length] = firstName;
			if (middle) {
				if (middleInitial) name[name.length] = middleName[0];
				else name[name.length] = middleName;
			}
			name[name.length] = lastName;
		}
		if (suffix) name[name.length] = suffixName;
		if (length == nameLength(name)) return name;
	}	
}

